import styled from 'styled-components';

const CategoriesContainer = styled.div`
  max-width: 800px;
  margin: 0 auto;
  padding: 2rem;
`;

function Categories() {
  return (
    <CategoriesContainer>
      <h1>文章分类</h1>
      <div>
        <h2>技术</h2>
        <ul>
          <li>React 相关文章</li>
          <li>JavaScript 教程</li>
        </ul>
        <h2>生活</h2>
        <ul>
          <li>旅行日记</li>
          <li>读书笔记</li>
        </ul>
      </div>
    </CategoriesContainer>
  );
}

export default Categories;
